import { 
    IonButton,
    IonButtons, 
    IonIcon
} from '@ionic/react';
import { returnDownBack } from 'ionicons/icons';
import React from 'react';

interface ContainerProps {
    name: string;
}

function defaultUrl() {
    const url:string = 'href="/"';

    switch(url) {
        case 'href="/"':
            <IonButtons slot="end">
                <IonButton {...url}>
                    <IonIcon slot="icon-only" icon={returnDownBack}></IonIcon>
                </IonButton>
            </IonButtons>
            break;
    }
}
const BackBtn: React.FC<ContainerProps> = ({ name }) => {
    return (
        defaultUrl()
    )
}

export default BackBtn;
